import React, { PureComponent } from 'react';
import EyeIcon from "../Image/eyeIcon.png";
import datas from "./statics.json";
import style from "./emergencyTable.module.css";
export default class Event extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
            data: datas
	   };
    }
	getData=()=> {
		let table = [];
		for(let i=0;i<this.state.data.length;i++){
			table.push(
				 <tr  style={{width:'100px',height:'200px'}}>
					<td>this.state.data[i].selectedNameValue</td>
					<td>this.state.data[i].selectedTypeValue</td>
					<td>this.state.data[i].selectedLevelValue</td>
					<td>this.state.data[i].selectedStatusValue</td>
					<td><img src={EyeIcon} alt="" style={{width:'15px',height:'15px'}}/></td>
                </tr>
			);
		}
		return table;
	}
    render() {
        return (
           <div style={{width:'300px',height:'400px'}}>
				<div>应急事件列表</div>
                <table style={{width:'200px',height:'200px'}}>
                    <thead>
                        <tr >
                            <th>应急事件名称</th>
                            <th>类型</th>
                            <th>等级</th>
							<th>状态</th>
							<th>查看</th>
                        </tr>
                    </thead>
                    <tbody style={{width:'200px',height:'200px'}}>
                        {this.getData()}
                    </tbody>
                </table>
            </div>
        )
    }
}
